define("3rdlibs/angular/docs/examples/example-text-input-directive/protractor",["dojo","dijit","dojox"],function(e,t,i){var n=element(by.binding("example.text")),o=element(by.binding("myForm.input.$valid")),l=element(by.model("example.text"));it("should initialize to model",function(){expect(n.getText()).toContain("guest"),expect(o.getText()).toContain("true")}),it("should be invalid if empty",function(){l.clear(),l.sendKeys(""),expect(n.getText()).toEqual("text ="),expect(o.getText()).toContain("false")}),it("should be invalid if multi word",function(){l.clear(),l.sendKeys("hello world"),expect(o.getText()).toContain("false")})});